import React, { Component } from 'react';
import { Map, Marker, GoogleApiWrapper} from 'google-maps-react';

const mapStyles = {
  width: '100%',
  height: '100%'
};

export class MapContainer extends Component {
  render() {


    return (
      <Map
        google={this.props.google}
        zoom={10}
        style={mapStyles}
        initialCenter={{
            lng: 83.323685,
            lat: 17.714294
          }}>
        <Marker key="marker_1"
          position={{

            lng: 83.323685,
            lat: 17.714294

          }}
          label={{
            text: "RK BEACH",
            fontFamily: "Arial",
            fontSize: "20px",
            color: "black"
          }}
        />
        <Marker key="marker_1"
          position={{

            lng: 83.34519670139929 ,
            lat: 17.748298645238204

          }}
          label={{
            text: "KAILASH GIRI",
            fontFamily: "Arial",
            fontSize: "20px",
            color: "black"
          }}
        />
        <Marker key="marker_1"
          position={{

            lng: 83.34854542564264 ,
            lat: 17.74734806039722

          }}
          label={{
            text: "TENNETI PARK",
            fontFamily: "Arial",
            fontSize: "20px",
            color: "black"
          }}
        />
        
        <Marker key="marker_1"


        position={{

        lng: 78.47470741698163,
        lat: 17.361696696371606

        }}
        label={{
        text: "CHARMINAR",
        fontFamily: "Arial",
        fontSize: "20px",
        color: "black"
        }}
        />
        <Marker key="marker_1"


        position={{

          lng: 79.34776812108626,
          lat: 13.684474045692369

        }}
        label={{
          text: "TIRUMALA",
          fontFamily: "Arial",
          fontSize: "20px",
          color: "black"
        }}
        />
        <Marker key="marker_1"


        position={{

          lng: 82.8792522280164,
          lat: 18.32246705318015

        }}
        label={{
          text: "ARAKU",
          fontFamily: "Arial",
          fontSize: "20px",
          color: "black"
        }}
        />
        <Marker key="marker_1"


        position={{

          lng: 79.57472384375572,
          lat: 18.003847621501116

        }}
        label={{
          text: "THOUDSAND PILLAR TEMPLE",
          fontFamily: "Arial",
          fontSize: "20px",
          color: "black"
        }}
        />
      </Map>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyD1hrUHm5CzRtbuAkoBvCgAGjhEv-Xt4Vc'
})(MapContainer);
